import React from "react";
import logo from "../images/logo.svg";
import { Link } from "react-router-dom";

function Register() {
  const [email, setEmail] = React.useState("");
  const [password, setPassword] = React.useState("");

  function handleSubmit(e) {
    e.preventDefault();
    const userData = {
      email,
      password,
    }
  }
  return (
    <div className="register">
      <header className="register__header">
        <img className="register__logo" src={logo} alt="around the u.s logo" />
        <Link className="login__signup" to="/register">Log in</Link>
      </header>
      <form className="register__form" onSubmit={handleSubmit}>
        <h1 className="register__title">Sign up</h1>
        <fieldset className="register__fieldset">
        <input
          id="email"
          type="text"
          name="email"
          placeholder="Email"
          className="register__input register__input_type_email"
          onChange={(e) => setEmail(event)}
          required
        />
        <input
          id="password"
          type="password"
          name="password"
          placeholder="Password"
          className="register__input register__input_type__password"
          minLength="2"
          maxLength="12"
          required
        />
        </fieldset>
        <button className="register__button" type="submit">Sign up</button>
        </form>
        <p className="register__Already-member">Already a member? {' '}
        <Link className="login__link" to="/signup">Sign in here!</Link></p>
    </div>
  );
}

export default Register;
